/* Reset for consistency */
* { margin: 0; padding: 0; box-sizing: border-box; }
body { font-family: 'Arial', sans-serif; font-size: 16px; }

/* Test-specific CSS */
.container {
    width: 800px;
    height: 300px;
    display: flex;
    gap: 20px;
    border: 2px solid #333;
    padding: 15px;
}
.item {
    flex: 1;
    padding: 10px;
    box-sizing: border-box;
    background-color: #f8f9fa;
    border: 1px solid #dee2e6;
}
table {
    width: 100%;
    border-collapse: collapse;
    font-size: 12px;
}
th, td {
    border: 1px solid #dee2e6;
    padding: 4px 6px;
    text-align: left;
}
th {
    background-color: #e9ecef;
    font-weight: bold;
}
tr:nth-child(even) {
    background-color: #f8f9fa;
}
.table-container {
    margin: 8px 0;
}
h5 {
    margin-bottom: 8px;
    font-size: 13px;
    color: #495057;
}
.simple-table {
    border: none;
}
.simple-table td {
    border: none;
    padding: 2px 4px;
}
